import * as API from './services/pokemons.js';
import { useEffect, useState } from 'react';
import { POKE_IMAGE_BASE, LOGO } from './constants.js';

export default function App() {
    const [pokemons, setPokemons] = useState([])

    useEffect(() => {
        API.getKantoPokemons().then(setPokemons)
    }, [])

    return (
        <>
            {/* <img src={LOGO} width={300} alt='PokÃ©mon'/> */}
            {pokemons.results != null && pokemons.results.map(p => PokemonCard(p))}
        </>
    );
}

const PokemonCard = (pokemon) =>
    <a href=''>
        <img
            width={230}
            alt={pokemon.name}
            key={pokemon.name}
            src={`${POKE_IMAGE_BASE}${pokemon.name}.png`}
        />
        <h5>{pokemon.name}</h5>
    </a>
